import React from 'react'
import { Button } from '../../Common/Static'

export default function RsvpListItem(props) {
  return (
    <li >
    {
      props.person.response === 'maybe' ? 
      <Button text={props.person.name} clickAction={props.setSelected(props.person)} className="listItemMaybe"/>
     : props.person.response === 'yes'  ? 
      <Button text={props.person.name} clickAction={props.setSelected(props.person)} className="listItemYes"/>
      : 
      <Button text={props.person.name} clickAction={props.setSelected(props.person)} className="listItemNo"/>
}
    </li>
  )
}
